import React from 'react';
import ReactDOM from 'react-dom/client';
import './style.scss';
import reportWebVitals from './reportWebVitals';

let hidden = "right";


function Quiz() {


function Right() {
  hidden = "";
}


function Wrong() {

}
  return (
    <div className="quiz-app">
      <h1 className='headline'>Вікторина</h1>
      <ul>Яке місто є столицею України?
        <button className="" onClick={Right}>Київ</button>
        <h2 className={`${hidden}`}>Вірно!</h2>
        <button className='b' onClick={Wrong}>Анкара</button>
        <button className='c' onClick={Wrong}>Хокайдо</button>
        <button className='d' onClick={Wrong}>Янґон</button>
      </ul>
      <ul>Де живе Ілон Маск?
        <button className='a' onClick={Wrong}>В Преторії</button>
        <button className='b' onClick={Right}>В Лос-Анджелесі</button>
        <h2 className='hidden'>Вірно!</h2>
        <button className='c' onClick={Wrong}>В Полтаві</button>
        <button className='d' onClick={Wrong}>В Вінніпезі</button>
      </ul>
      <ul>Де вперше було помічено спалах коронавірусу?
        <button className='a' onClick={Wrong}>У місті Бидгощ, Польща</button>
        <button className='b' onClick={Wrong}>У місті Нью-Йорк, США</button>
        <button className='c' onClick={Wrong}>У місті Усурійськ, РФ</button>
        <button className='d' onClick={Right}>У місці Ухань, КНР</button>
        <h2 className='hidden'>Вірно!</h2>
      </ul>
      <ul>Коли було зафіксовано перший спалах коронавірусу?
        <button className='a' onClick={Wrong}> Початок 2019-го року</button>
        <button className='b' onClick={Right}> Кінець 2019-го року</button>
        <h2 className='hidden'>Вірно!</h2>
        <button className='c' onClick={Wrong}>Початок 2020-го року</button>
        <button className='d' onClick={Wrong}>Кінець 2020-го року</button>
      </ul>
      <ul>Яка страва є традиційною на День подяки в США?
        <button className='a' onClick={Wrong}>Морозиво</button>
        <button className='b' onClick={Right}>Індичка</button>
        <h2 className='hidden'>Вірно!</h2>
        <button className='c' onClick={Wrong}>Торт</button>
        <button className='d' onClick={Wrong}>Рисове рагу</button>
      </ul>
      <button className='submit' type='submit'>Завершити</button>
    </div>
  );
}
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Quiz />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
